    false,nt"url": null,nt"notes": "Several pre-existing datasets that characterize
    portions of the Northern High Plains aquifer base were merged together in order
    to define the entire base of the Northern High Plains aquifer. This digital dataset
    consists of the aquifer base elevation contours (100-foot contour interval) for
    the northern portion of the High Plains aquifer in the central United States. The
    boundaries were chosen to simplify boundary conditions for a computer simulation
    model being used for a hydrologic study of the Northern High Plains.",nt"license_title":
